  state = {
    isLodaing: true,
    brandList:[]
    }
  getData= async () => {
    try {
      const data = await axios.get('http:/localhost:8000/dummy.json');
      this.setState({ data, isLoading: false });
      console.log('dadad' + data);
    }
    catch (error) {
      console.log(error);
    }
  }
  componentDidMount() {
    // this.getData();
    fetch('dummy.json')
      .then(function (result) {
